import Layout from '../components/MyLayout.js'
import Gallery from "react-photo-gallery";

export default class About extends React.Component {
  images = [
    "https://noxxembirphotostorage.sfo2.digitaloceanspaces.com/Product/180909_EMS_20038.jpg",
    "https://noxxembirphotostorage.sfo2.digitaloceanspaces.com/Product/180924_EMS0068-2.jpg",
    "https://noxxembirphotostorage.sfo2.digitaloceanspaces.com/Product/181001_EMS0029.jpg",
    "https://noxxembirphotostorage.sfo2.digitaloceanspaces.com/Product/181105_EMS0056%20copy.jpg",
    "https://noxxembirphotostorage.sfo2.digitaloceanspaces.com/Product/181201_EMS02177_3.jpg",
    "https://noxxembirphotostorage.sfo2.digitaloceanspaces.com/Product/181206_EMS0056.jpg"
  ]
  render() {
    console.log(this.state);
    return (
      <Layout>
        <Gallery photos={this.images.map(src => ({src, width: 140, height: 140}) )} />
      </Layout>
    )
  }
}
